import React, { useRef, useLayoutEffect } from 'react';
import logo from './logo.svg';
import * as am4core from "@amcharts/amcharts4/core";
import * as am4charts from "@amcharts/amcharts4/charts";
import am4themes_animated from "@amcharts/amcharts4/themes/animated";
import styled from 'styled-components';
import {space, color, layout} from 'styled-system';
import Card from 'react-bootstrap/Card';
import axios from 'axios'

var user_id = "634739719";

am4core.useTheme(am4themes_animated);

function IconArray(props) {

  useLayoutEffect(() => {
    let x = am4core.create(props.divid, am4charts.XYChart);

    x.paddingRight = 20;
    x.paddingLeft = 20;

    /* Chart code */
// Themes begin
am4core.useTheme(am4themes_animated);
// Themes end

// Chart
// Create chart instance
let chart = am4core.create(props.divid, am4charts.XYChart);
chart.colors.step = 3;

// Add data
chart.data = [ {
  "y": 10,
  "x": 14,
  "value": 59,
  "y2": -5,
  "x2": -3,
  "value2": 44
}, {
  "y": 5,
  "x": 3,
  "value": 50,
  "y2": -15,
  "x2": -8,
  "value2": 12
}, {
  "y": -10,
  "x": 8,
  "value": 19,
  "y2": -4,
  "x2": 6,
  "value2": 35
}, {
  "y": -6,
  "x": 5,
  "value": 65,
  "y2": -5,
  "x2": -6,
  "value2": 168
}, {
  "y": 15,
  "x": -4,
  "value": 92,
  "y2": -10,
  "x2": -8,
  "value2": 102
}, {
  "y": 13,
  "x": 1,
  "value": 8,
  "y2": -2,
  "x2": 0,
  "value2": 41
}, {
  "y": 1,
  "x": 6,
  "value": 35,
  "y2": 0,
  "x2": -3,
  "value2": 16
} ];

// Create axes
let xAxis = chart.xAxes.push(new am4charts.ValueAxis());
xAxis.renderer.minGridDistance = 50;

let yAxis = chart.yAxes.push(new am4charts.ValueAxis());
yAxis.renderer.minGridDistance = 50;

// Create series #1
let series = chart.series.push(new am4charts.LineSeries());
series.dataFields.valueY = "y";
series.dataFields.valueX = "x";
series.dataFields.value = "value";
series.strokeOpacity = 0;
series.name = "Series 1";

let bullet = series.bullets.push(new am4charts.CircleBullet());
bullet.strokeOpacity = 0.2;
bullet.stroke = am4core.color("#ffffff");
bullet.nonScalingStroke = true;
bullet.tooltipText = "x:{valueX} y:{valueY}";
series.heatRules.push({
  target: bullet.circle,
  min: 10,
  max: 60,
  property: "radius"
});

// Create series #2
let series2 = chart.series.push(new am4charts.LineSeries());
series2.dataFields.valueY = "y2";
series2.dataFields.valueX = "x2";
series2.dataFields.value = "value2";
series2.strokeOpacity = 0;
series2.name = "Series 2";

let bullet2 = series2.bullets.push(new am4charts.Bullet());
bullet2.tooltipText = "x:{valueX} y:{valueY}";
bullet2.layout = "absolute";
bullet2.rotation = 45;

let rectangle = bullet2.createChild(am4core.Rectangle);
rectangle.verticalCenter = "middle";
rectangle.horizontalCenter = "middle";
rectangle.width = 10;
rectangle.height = 10;
rectangle.strokeOpacity = 0.5;
rectangle.stroke = am4core.color("#ffffff");
rectangle.nonScalingStroke = true;

rectangle.verticalCenter = "middle";
rectangle.horizontalCenter = "middle";

series2.heatRules.push({
  target: rectangle,
  min: 1,
  max: 8,
  property: "scale"
});

chart.scrollbarX = new am4core.Scrollbar();
chart.scrollbarY = new am4core.Scrollbar();

chart.legend = new am4charts.Legend();


  }, []);

  return (
    <div>
        <div id={props.divid} style={{ width: "100%", height: "250px" }}></div>
    </div>
    
  );
}
export default IconArray;
